import React from "react";
import "./blogs.css";
const Blogs = () => {
  return (
    <>
      <div className="blog-container">
        <div className="blog-head">
          <div className="blog-head-left"></div>
          <div className="blog-head-right"></div>
        </div>
      </div>
    </>
  );
};
export default Blogs;
